import React from "react";
import { Parallax } from "react-scroll-parallax";

//COMPONENTS
import Line from "../2_module/Line";
import BackgroundImg from "./BackgroundImg";

//STYLES
import { HeaderStyle } from "../../2_styles/1_layout/HeaderStyle";
import { BackgroundImgStyle } from "../../2_styles/1_layout/BackgroundImgStyle";

export default function Header({ bgImg, title, subtitle }) {
  return (
    <div>
      <HeaderStyle>
        {/* <BackgroundImg
          bgImg={bgImg}
          height="100vh"
          zIndexImg="-4"
          zIndexImgShadow="-3"
        /> */}

        <Parallax className="custom-class" y={[-20, 20]} tagOuter="figure">
          <Image src="/image.jpg" />
        </Parallax>

        <div className="title">
          <p>the</p>
          <p>{title}</p>
          <Line />
          <p>{subtitle}</p>
        </div>
      </HeaderStyle>
    </div>
  );
}
